import "./dashbb.css";
import React, { useContext, useEffect, useState } from "react";
import axios from "axios";
// import { Context } from "../../../context/Context";

export default function Dashbb() {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    const fetchPosts = async () => {
      const res = await axios
      .get("https://jsonplaceholder.typicode.com/posts")
      console.log(res);
        setPosts(res.data);
      // .then((res) => {
      //   console.log(res);
      //   setPosts(res.data);
      // })
      // .catch((err) => {
      //   console.log(err);
      // });
    };
    fetchPosts();
  }, []);

  return (
    <div className="dashbb-g">
      <div className="row-md">
        <div className="book">
          <ul>
            {posts.map(post => {
              <li key={post.id} style={{ fontSize: "2em" }}>
              {post.title}
              <p className="purchase-count" style={{ fontSize: "0.5em" }}>
                Sold: 20
              </p>
            </li>
            })}
            
          </ul>
        </div>
      </div>
    </div>
  );
}
